  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Ninigret
  National Wildlife Refuge Complex (including Ninigret NWR, Block Island NWR, Pettaquamscutt
  Cove NWR, Sachuest Point NWR, and Trustom Pond NWR) outlines Refuge accomplishments
  during the 1992 calendar year. The report begins with a summary of the year's highlights
  and weather conditions. The report includes a planning section which discusses the
  master plan, management planning, and research and investigations. Refuge administration
  is outlined; information about personnel, youth programs, volunteer programs, funding,
  safety, and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, croplands, grasslands, haying, fire management, and pest control.
  The wildlife section of the report discusses endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, and marine mammals.
  The public uses of the Refuge described in this report include outdoor classrooms,
  interpretive programs, fishing, wildlife observation, and law enforcement. The equipment
  and facilities section of the report provides information about new construction,
  rehabilitation, major maintenance, equipment replacement, and communication systems.
  Cooperative programs and items of interest are provided at the end. Refuge brochures
  and field guides are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
